import React from 'react';
import { useParams } from 'react-router-dom';

function Booking() {
  const { mode } = useParams();

  
  return (
    <div>
      <form>
        <div className=' mx-2 flex-col'>
        <div><label className='m-2'>From</label></div>
        <div><input className='m-2' type='text' placeholder='Start'/></div>
        </div>
      </form>
  
    </div>
  );
}

export default Booking;
